Skateboarding isn’t easy!
Life isn’t easy.
But I don’t care I do what i got to do.
Big thanks for those who help me to make this project come true! I’m so happy right now 
I got no words to describe this feeling!
Much love 
Thank you skateboarding 

@tonyhawk 
@davisonfortunato 
@danstolling 
@rhino 
@dupedupe 
@burnout 
@thrashermag 
@birdhouseskateboards 
@vans 
@vansskate 
@independenttrucks 
#noexcuses #limitless

Andar de skate não é fácil!
 A vida não é fácil.
 Mas eu não me importo, eu faço o que tenho que fazer.
 Muito obrigado a todos aqueles que me ajudaram a realizar este projeto!  Estou tão feliz agora
 Não tenho palavras para descrever esse sentimento!
 Muito amor
 Obrigado 🛹

